import React ,{useEffect,useState}from 'react';
import "./home.css";
import{Image}from"cloudinary-react"
import Axios from"axios"

const home = () => {

    const [list,setList]=useState([]);

    useEffect(()=>{
        Axios.get("http://localhost:3001/upload").then((res)=>{
            setList(res.data)
        })
    },[])


    return (

        <div>
            {list.map((val)=>{
                return(
                <div className="home">
                <div className="post">
                    <div className="image">
                        <Image cloudName="dyflxpls8" publicId={val.imageid}/>
                    </div>
                    <div className="text">
                        <div className="title">{val.title}by{val.username}</div>
                        <div className="discription">{val.description}</div>
                    </div>
                </div>
            </div>)
            })}

        </div>
    );
};



export default home;
